import React, { Component } from "react";
 
class Menu extends Component {
  render() {
    return (
      <div>
      <table>
        <tr>
          <th><b>(A) Shrimp w. Head (1lb) and Snow Crab Legs (1lb)</b></th>
          <th><b>(B) Shrimp w. Head (1lb) and Snow Crab Legs (1lb)</b></th>
          <th><b>(C) Shrimp w. Head (1lb) and Snow Crab Legs (1lb)</b></th>
          <th><b>(D) Shrimp w. Head (1lb) and Snow Crab Legs (1lb)</b></th>
        </tr>
        <tr>
          <td>Comes with 2 Corn and 2 Potatoes. Seasonings: Cajun,<br>
                Lemon Pepper, Garlic Butter, Creole or the Twisted Sauce</br>
                <br><b>$39.50</b></br></td>
          <td>Comes with 2 Corn and 2 Potatoes. Seasonings: Cajun,<br>
                Lemon Pepper, Garlic Butter, Creole or the Twisted Sauce</br>
                <br><b>$39.50</b></br></td>
          <td>Comes with 2 Corn and 2 Potatoes. Seasonings: Cajun,<br>
                Lemon Pepper, Garlic Butter, Creole or the Twisted Sauce</br>
                <br><b>$39.50</b></br></td>
        </tr>
      </table>
      </div>
    );
  }
}
export default Menu;
